import { Button } from '@material-ui/core';
import React from 'react';
import './style.css';


const App = () => {
  return (
    <>
      <div className="login">
          <h1>Instagram</h1>
          <input type="username" type="text" />
          <label htmlFor="username">           Phone number, username, or email</label>
          <input id="password" type="text" placeholder="Password" />
          <label htmlFor="password">Password</label>
          <button>Log In</button>
          <p class="has-separator">Or</p>
      </div>

      <div className="floating-label-wrap">
        <input type="text" class="floating-label-field floating-label-field--s3" id="field-1" placeholder="Field 1"></input>
        <label for="field-1" class="floating-label">Field 1</label>
      </div>

    </>
  );
}

export default App;
